   * so that all the labels and fields line up automatically. */
  &.spectrum-Form--positionSide {
    display: table;
    border-collapse: separate;
    border-spacing: var(--spectrum-tableform-border-spacing);
    margin: var(--spectrum-tableform-margin);
    text-align: start;

    .spectrum-Field {
      display: table-row;
      width: 100%;
